import React from 'react';

const Manager = () => {
  return (
    <div className="header-mngr" dir="rtl">
      <h1 className="header-h1"><span className="header-h1-red">ص</span><span className="header-h1-green">ن</span><span className="header-h1-blue">دو</span><span className="header-h1-yellow">ق </span><span className="header-h1-red">یا</span><span className="header-h1-blue">ر</span></h1>
      <p className="header-p">صندوقتان را مدیریت کنید!</p>
    </div>
  );
}

export default Manager;
